import React, { useEffect, useState } from 'react';
import { Container } from 'react-bootstrap';
import appServices from '../../services/appServices';
import './final_project.css';

const Final_Project = () => {
    const [dataFinal, setData] = useState([]);
    useEffect(() => {
        appServices.getAllData().then((result) => {
            setData(result.data);
        });
    }, []);

    return (
        <div className="finalBody">
            <h1>OUR PROUD PROJECT</h1>
            <Container>
                <div>
                    <input className="search" type="text" placeholder="Search"></input>
                </div>
                <div className="data">
                    <table style="text-align: center">
                        <tr>
                            <th width="50px">Title</th>
                            <th width="50px">Author</th>
                            <th width="50px">Year</th>
                        </tr>
                        {dataFinal.map((data) => {
                            return (
                                <tr>
                                    <td>{data.title}</td>
                                    <td>{data.author}</td>
                                    <td>{data.year}</td>
                                </tr>
                            )
                        })}
                    </table>
                </div>
            </Container>
        </div>
    )
}

export default Final_Project;
